import React from "react";
import { AppBar, Toolbar, Typography, Box } from "@mui/material";

const Header = () => (
  <AppBar
    position="fixed"
    color="primary"
    sx={{
      width: "100%",
      top: 0,
      left: 0,
      right: 0,
      padding: "10px 0", // Adds padding to the top and bottom
    }}
  >
    <Toolbar
      sx={{
        display: "flex",
        justifyContent: "center", // Centers the content horizontally
        alignItems: "center", // Vertically aligns content
      }}
    >
      <Typography variant="h5" sx={{ fontWeight: "bold", letterSpacing: "2px" }}>
        Quiz App
      </Typography>
    </Toolbar>
  </AppBar>
);

export default Header;
